import React from 'react';
import ContactForm from '../components/ContactForm';
import Col from "react-bootstrap/Col";


function Contact() {
    return (
        <div id="contact" className="">
            <Col>
            <section className="p-3">
               

               <ContactForm />
           </section>
            </Col>
           
        </div>
    );
} 

export default Contact;
